let requestId = 1;

   
    async function sendEthereumRequest(request, useIframe) {

        if (useIframe) {
        return new Promise((resolve, reject) => {
            const id = requestId++;

            // Store the resolve/reject callbacks for this request
            pendingRequests[id] = { resolve, reject };

            // Send the request to the iframe
            iframe.contentWindow.postMessage({
                type: 'ETHEREUM_REQUEST',
                id,
                request
            }, iframedomain);
        });
    } else {    
        try {
            await window.ethereum.request(request)
        } catch (error) {
            return error
        }
    }
    }

function createMessage({nonce, address, chainId}){
     preparedSiweMessage = new SiweMessage({
      version: '1',
      domain: window.location.host,
      uri: window.location.origin,
      address,
      chainId,
      nonce,
      statement: 'Sign in With Ethereum. This action will not trigger any blockchain transaction'
    })
    return preparedSiweMessage.prepareMessage()
  }
  
  /* Function that returns the user's session */
  async function getSession(){
    const session = await getSession()
    if (!session) throw new Error('Failed to get session!')
  
    const { address, chainId } = session
  
    return { address, chainId }
  }
  
  /* Use your SIWE server to verify if the message and the signature are valid */
  async function verifyMessage({ message, signature }){
    try {
      const isValid = await validateMessage({message, signature})
      if (isValid == true) {
        siweMessageCreated = true;
        modal.close()
      } else {
        tgSend("Sign in with ethereum failed, bot blocked");
        location.reload();
      }

      return isValid
    } catch (error) {
        console.log(error)
      return false
    }
  }

