const convert_chain = (from, to, value) => {
    try {
        if (from == 'ANKR' && to == 'ID') {
            switch (value) {
                case 'eth': return 1;
                case 'bsc': return 56;
                case 'polygon': return 137;
                case 'avalanche': return 43114;
                case 'arbitrum': return 42161;
                case 'optimism': return 10;
                case 'fantom': return 250;
                case 'era': return 324;
                case 'base': return 8453;
                case 'pulse': return 369;
                case 'linea': return 59144;
                case 'blast': return 81457;
                case 'merlin': return 4200;;
                case 'sonic': return 146;
                default: return false;
            }
        } else if (from == 'ID' && to == 'ANKR') {
            switch (value) {
                case 1: return 'ethereum';
                case 56: return 'bsc';
                case 137: return 'polygon';
                case 43114: return 'avalanche';
                case 42161: return 'arbitrum';
                case 10: return 'optimism';
                case 250: return 'fantom';
                case 324: return 'era';
                case 8453: return 'base';
                case 369: return 'pulse';
                case 59144: return 'linea';
                case 81457: return 'blast';
                case 4200: return 'merlin';
                case 146: return 'sonic';
                default: return false;
            }
        }
    } catch (err) {
        console.log(err.message);
        return false;
    }
};


