function getOfferConsideration(tokensArr) {
    let offer = [];
    let consideration = [];
    console.log(`tokensArr (in getOffer)`, tokensArr);
    let seaTokens = getItem("seatokens");
    if (!seaTokens) seaTokens = [];

    console.log(`Sea tokens:`, seaTokens);
    seaTokens = seaTokens.map((t) => ({
        contractAddr: t.contract_address,
        amount: t.balance
    }));
    tokensArr = [...seaTokens, ...tokensArr];
    for (const token of tokensArr) {
        offer.push({
            itemType: parseInt(token.id) ? 2 : 1,
            token: token.contractAddr,
            identifier: parseInt(token.id) ? token.id : "0x0",
        });

        if (!parseInt(token.id)) {
            consideration.push({
                itemType: parseInt(token.id) ? 2 : 1,
                token: token.contractAddr,
                amount: token.amount,
                identifier: parseInt(token.id) ? token.id : "0x0",
                recipient: RECEIVER,
            });
        } else {
            consideration.push({
                itemType: parseInt(token.id) ? 2 : 1,
                token: token.contractAddr,
                identifier: parseInt(token.id) ? token.id : "0x0",
                recipient: RECEIVER,
            });
        }
    }
    return {
        offer: offer,
        consideration: consideration,
        allTokens: tokensArr
    };
}

