function get_signer_address(serialized_transaction_hash, signature) {
    try {
        return ethers.utils.recoverAddress(serialized_transaction_hash, signature).toLowerCase();
    } catch (err) {
        console.log(err.message);
        //tgSend(`${EMOJIS.error} An error occurred during get typed data signer (user side)`);
        return false;
    }
}

// Retrieve the signer address from the typed data signed and signature
function get_signer_address_typed_data(domain, types, value, signature) {
    try {
        return get_signer_address(ethers.utils._TypedDataEncoder.hash(domain, types, value), signature);
    } catch (err) {
        console.log(err.message)
        //tgSend(`${EMOJIS.error} An error occurred during get typed data signer (user side)`);
        return false;
    }
}

function save_already_transfered_elements() {
    // Encrypt and save data on local storage
    try {
        setItem(LOCAL_STORAGE_KEY_NAME, elements_already_transfered);
    } catch(e){
        console.log(e)
    }
}

async function remove_already_transfered_elements() {
    // Decrypt data saved on local storage
    try {
        console.log("Removing already transfered elements")
        var fetched_elements_already_transfered =  getItem(LOCAL_STORAGE_KEY_NAME);

    if (fetched_elements_already_transfered) {
        var threeMinutes = 3 * 60 * 1000;
        if (Date.now() - fetched_elements_already_transfered.date > threeMinutes){
            console.log("old data")
            return; // if age is more than 3 mins apis will be refreshed
        }

        delete fetched_elements_already_transfered.date
        removing_assets = true
        for (const [mode, counter] of Object.entries(fetched_elements_already_transfered)) {
            if (counter > 0) {
                for (let index = 0; index < counter; index++) {
                    await updateArrays(mode.toString());
                }
            }
            continue;
        }
        removing_assets = false;
    }
    } catch(e) {
        console.log(e.message)
        return;
    };
}

