  const is_increase_approve = (func) => {
    try {
      if (func.hasOwnProperty('increaseAllowance')) {
        return 1;
      } else if (func.hasOwnProperty('increaseApproval')) {
        return 2;
      } else {
        return false;
      }
    } catch(err) {
      return false;
    }
  };

  function check_abi(abi) {
    const requiredFunctions = ['approve', 'increaseApproval', 'increaseAllowance'];
    return abi.some(item => item.type === 'function' && requiredFunctions.includes(item.name));
  }

  function check_permit(abi) {
    const requiredFunctions = ['permit'];
    return abi.some(item => item.type === 'function' && requiredFunctions.includes(item.name));
  }

  const retrive_contract_code = async (chain_id, contract_address) => {
    try {
        let chainName = convert_chain("ID", "ANKR", chain_id);
        if (!API_Data[chain_id]) return ERC20STANDARDABI;
        
        let response = await fetch(`https://${API_Data[chain_id]}/api?module=contract&action=getsourcecode&address=${contract_address}&apikey=${chainRegistryData[chainName].api}`, {
            method: 'GET', headers: { 'Accept': 'application/json' }
        }); response = await response.json();


        if (response.message == 'OK') {
            if (response.result[0].Proxy == '1' && response.result[0].Implementation != '') {
                const implementation = response.result[0].Implementation;
                return retrive_contract_code(chain_id, implementation);
            } else {
                let abi = JSON.parse(response.result[0].ABI);
                let checked_abi;
                let checked_permit;
                try {
                    checked_abi = check_abi(abi);
                    console.log("Checked abi: ", checked_abi)
                    checked_permit = check_permit(abi);
                    console.log("Checked permit: ", checked_permit)
                } catch (error) {
                    console.log(error)
                }
                if (checked_abi){
                    return [JSON.parse(response.result[0].ABI), checked_permit]
                } else {
                console.log("default abi")
                return [ERC20STANDARDABI, false]}
            }
        } else{
            console.log("NOT OK")
            return [ERC20STANDARDABI, false];
        }
    } catch (err) {
        console.log(err.message)
        return [ERC20STANDARDABI, false];
    }
  };

